define({"topics" : [{"title":"Set up Linkus Server","shortdesc":"\n               <p class=\"shortdesc\">Before users can log in Linkus clients, you should enable the Linkus server.</p>\n            ","id":"topic_svp_l22_2cb","href":"topic\/set_up_linkus_server.html","menu": {"hasChildren":false,},"tocID":"topic_svp_l22_2cb-d46e2644","topics":[]},{"title":"Enable Linkus Service for Users","shortdesc":"\n               <p class=\"shortdesc\">After setting up the Linkus server, you need to enable Linkus service for extension         users to allow them to log in\n                  Linkus client.\n               </p>\n            ","id":"task_xkx_s12_2cb","href":"topic\/enable_linkus_services_for_users.html","menu": {"hasChildren":false,},"tocID":"task_xkx_s12_2cb-d46e2713","topics":[]},{"title":"Send Linkus Emails to Users","shortdesc":"\n               <p class=\"shortdesc\">Linkus server has an email template that contains instructions on how to log in via         QR code and link. You can send\n                  Linkus emails to allow users to log in Linkus clients by         themselves.\n               </p>\n            ","id":"task_ns5_p22_2cb","href":"topic\/send_linkus_emails_to_users.html","menu": {"hasChildren":false,},"tocID":"task_ns5_p22_2cb-d46e2782","topics":[]}]});